import classes from './HomeItems.module.css';
import ItemTile from './ItemTile';


const HomeItems = props =>{

    return (
   
        <div className={classes.container}>
        <ItemTile imgName="Subttasks" content="Create Sub-tasks"></ItemTile>
        <ItemTile imgName="Paper_fill" content="Set    Priorities"></ItemTile>
        <ItemTile imgName="Waterfall" content="Track your progress"></ItemTile>
        </div>
        
    );



}

export default HomeItems;
